import{_ as a,o as t,c as e,Q as o}from"./chunks/framework.e90f0c97.js";const r="/assets/F12.5ea4b8dd.png",_=JSON.parse('{"title":"T1.初识HTML","description":"","frontmatter":{"prev":{"text":"简介","link":"./"},"next":{"text":"T2.了解网页F12开发者工具","link":"./T2.了解网页F12开发者工具"}},"headers":[],"relativePath":"md/前端/T1.初识HTML.md","filePath":"md/前端/T1.初识HTML.md"}'),l={name:"md/前端/T1.初识HTML.md"},s=o('<p><img src="https://pic.imgdb.cn/item/64c4a5611ddac507cc058875.png" alt="img"></p><h1 id="t1-初识html" tabindex="-1">T1.初识HTML <a class="header-anchor" href="#t1-初识html" aria-label="Permalink to &quot;T1.初识HTML&quot;">​</a></h1><blockquote><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">难度系数：简单</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">难度系数：简单</span></span></code></pre></div><p>相信你已经看过了前端的简介，对前端有了大致的了解。</p><p>或许你还有不少疑惑，但不要着急，都说实践出真知，接下来，我们希望通过一系列的题目，让你先知道我们学些什么，怎么学，以及怎么用，开启前端异世界大门。你需要根据下面的题目指引，完成任务。</p><p>如果遇到不会的，请参考我们提供的教程，大部分往往都会得到解决；同时前端的知识庞大而琐碎，所以需要你边学边做好笔记，以便将来需要用到的时候可以快速检索。当然了，你也可以在题目的底部找到题目的出题人，问问他们或许能找到不少帮助，祝你好运！</p></blockquote><h2 id="题目描述" tabindex="-1"><strong>题目描述</strong> <a class="header-anchor" href="#题目描述" aria-label="Permalink to &quot;**题目描述**&quot;">​</a></h2><h4 id="题目背景" tabindex="-1">题目背景 <a class="header-anchor" href="#题目背景" aria-label="Permalink to &quot;题目背景&quot;">​</a></h4><blockquote><p>你刚刚决定迈入前端的大门，有没有感觉一切都很新奇？神奇的HTML写法、令人眼花缭乱的CSS炫酷样式、让静态页面活起来的JavaScript和各种各样的框架生态......</p><p>不急！让我们从头开始，先试着给自己写一份个人简介，学习一下有关<strong>标签</strong>描述页面元素的方法。</p></blockquote><h4 id="任务" tabindex="-1">任务 <a class="header-anchor" href="#任务" aria-label="Permalink to &quot;任务&quot;">​</a></h4><p><strong>制作个人简介，向我们介绍一下你自己！</strong></p><ol><li><p>页面标题：显示为“我的简介”</p></li><li><p>包含主标题</p></li><li><p>简介需要包含自我介绍与你完成本题的心得</p></li><li><p>打开你编写的个人简介，使用<strong>开发者工具</strong>添加和修改你的简介内容，截图保存下来，再刷新一下页面，看看发生了什么？</p><p><img src="'+r+'" alt=""></p></li></ol><p><strong>可以添加的内容：</strong></p><ol><li>链接：<code>&lt;a&gt;</code> 指向你喜欢的网站</li><li>图片：<code>&lt;img&gt;</code> 展示一些你喜欢的图片！</li></ol><p><strong>可能的话</strong>，找一找还有哪些<strong>有趣的标签</strong>可以用上？可不可以让你的页面稍微整齐一点？</p><p><strong>本题需要提交代码。</strong></p><hr><h5 id="学习攻略" tabindex="-1"><strong>学习攻略</strong> <a class="header-anchor" href="#学习攻略" aria-label="Permalink to &quot;**学习攻略**&quot;">​</a></h5><ul><li><p>学习和了解什么是HTML标签 （一个基础的 HTML 框架是怎样的，meta 标签 、h1 标签 、div 标签 这些都是什么东西 ? ）</p></li><li><p>学习如何使用F12</p></li><li><p><a href="https://www.runoob.com/html/html-tutorial.html" target="_blank" rel="noreferrer">HTML 教程 | 菜鸟教程</a></p></li><li><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/HTML" target="_blank" rel="noreferrer">HTML|MDN </a></p></li><li><p>其他问题可以参考B站上的视频教程</p></li></ul><h2 id="本题提交方式" tabindex="-1"><strong>本题提交方式</strong> <a class="header-anchor" href="#本题提交方式" aria-label="Permalink to &quot;**本题提交方式**&quot;">​</a></h2><blockquote><p><a href="https://submit.glimmer.org.cn" target="_blank" rel="noreferrer"> 提交点这里 </a></p></blockquote><h2 id="出题者q-a方式" tabindex="-1"><strong>出题者Q&amp;A方式</strong> <a class="header-anchor" href="#出题者q-a方式" aria-label="Permalink to &quot;**出题者Q&amp;A方式**&quot;">​</a></h2><blockquote><p>QQ：3064517736</p><p>邮箱：3064517736@qq.com</p></blockquote>',20),i=[s];function n(p,c,h,d,g,m){return t(),e("div",null,i)}const b=a(l,[["render",n]]);export{_ as __pageData,b as default};
